import React from 'react';
import {connect} from 'react-redux';
import {Link, Redirect} from 'react-router-dom';
import placeholderimg from '../assets/placeholder.png';
import backgroundImg from '../assets/test/jpg';
import './landing-page.css';



export function LandingPage(props) {

    if (props.loggedIn) {
        return <Redirect to="/dashboard" />;
    }

    return (
        <div>
            <div className="hero-container">
                <div className="hero-row">
                    <div className="hero-content"> 
                        <h1 className="landing-title">Welcome to SQL Learning Labs!</h1>
                        <p className="landing-subtitle">SQL Learning Labs is designed for students of all skill levels to practice and master SQL Bash Commands! </p>
                    </div>
                </div>
            </div>
            <div className="hero-img">
                <div className="hero-img-row">
                    <div className="hero-img-content">

                    </div>
                </div>

            </div>

            <h2 className="landing-title">Welcome to SQL Learning Labs!</h2>
            <p className="landing-subtitle">SQL Learning Labs is designed for students of all skill levels
                to practice and master SQL Bash Commands!
            </p>
            <img src={placeholderimg} className="x" alt="x" />

            <Link to="/sign-up"><button>Sign Up</button></Link>

            <Link to="/login"><button>Login</button></Link>
        </div>
    );
}

const mapStateToProps = state => ({
    loggedIn: state.authReducer.currentUser !== null
});

export default connect(mapStateToProps)(LandingPage);
